// Dashboard.js
import React from 'react';

const UsersPage = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Make a GET request to the back-end to fetch the list of users
    fetch('http://localhost:8082/users', {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('userToken')}` // Send the user token if required
      }
    })
      .then((response) => response.json())
      .then((data) => {
        // Update the state with the fetched user data
        setUsers(data);
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }, []);

  return (
    <div>
      <h2>See All Users</h2>
      <ul>
        {users.map((user) => (
          <li key={user.id}>{user.username}</li>
        ))}
      </ul>
    </div>
  );
};

export default UsersPage;
